import React from 'react';

function VideoSearchLine (props) {
  let filterPanel
  return (
    <div className="searcLineLayout">
      <form onSubmit={props.gettingVideoId} className="form">
        <input type="text" name="searchQuery" autoComplete="off" className="string" value={props.searchQuery} onChange={props.textInputChange}/>
        <button checked={props.indicatorButtonSearch} onClick={props.clickButton} className="button">Найти</button>
      </form>
      {props.clickButton &&
        <div className="filterPanel">
           <div className="heading">
             Видео по запросу {props.searchQuery} {props.totalResults}
           </div>
           <div className="buttonFilter">
           </div>
         </div>
        }
    </div>
  )
}

export default VideoSearchLine
